const data=JSON.parse(wpcc_vars.data),atributos=JSON.parse(wpcc_vars.atributos);export function customCalculoCanto(a,o){if(a.customCalculosCantos=[],!document.querySelector('input[name="cantos"]'))return;const t=data.primas.tiempo_manipulado[1][0];let s;s="Copistería online"==productData.name?a.calculosInicialesCopisteria:a.customCalculosIniciales;const c=s.map(a=>a.cantidad),i=c.map(a=>parseInt(a)),n=[];i.forEach(a=>{const o=1.05*a,s=o/t;for(let o=0;o<data.primas.precio_hora_manipulado.length;o++)if(s>=data.primas.precio_hora_manipulado[o][2]&&s<=data.primas.precio_hora_manipulado[o][3]){const t=s*data.primas.precio_hora_manipulado[o][1],c=s*data.primas.precio_hora_manipulado[o][0],i={cantidad:a,detalles:{tiempoCantos:s,costeCantos:t,importeCantos:c}};n.push(i)}}),a.customCalculosCantos=n,console.log("Cálculos personalizados:",a.getCalculos())}